import '../App.css';
import React from "react";
import { Card } from "react-bootstrap";
import stashShelf from "../images/stash.jpeg";


function Home() {


    return (
        <Card style={{ backgroundColor: "lavender", color: "black", width: "500px" }}>
            <Card.Header>Welcome to Fabricadabra!</Card.Header>
            <Card.Body>
                <p>A magical place to keep a sewist's stash organized.</p>
                <img id="stashShelf" src={stashShelf}></img>
            </Card.Body>
        </Card>
      );

    }

    export default Home;
